from nltk.corpus import wordnet as wn

def get_word_frequency(word):
    synsets = wn.synsets(word)

    sense2freq = {}
    for s in synsets:
        freq = 0
        for lemma in s.lemmas:
            freq+=lemma.count()
        sense2freq[s.offset+"-"+s.pos] = freq

    for s in sense2freq:
        print(s, sense2freq[s])

